    const history = useHistory();
    
    return(
        <>
           <h1>Hi , this {fname} {lname} page</h1>
           <p>My current location is {location.pathname}</p>
           {
               location.pathname === `/User/raghav/singh` ? (<button>click me</button>) : null
           }
        </>
    );
}

